import {useEffect, useState} from 'react';


const useFetch = () => {

  const [data1, setData1] = useState({});
  const [loading, setLoading] = useState(true)
  const [error, setError] = useState(false)

  useEffect(() => {

    function myMessage() {
      console.log("message appeared");
   }


    const fetchData = async () => {
           try {
              const token = "eyJhbGciOiJSUzI1NiIsImtpZCI6IkQ1QjdBOUIxODFFOEYxN0UwRTU5MkFFQTdBREFDRjk4IiwieDV0IjoiZmFxUHJnMW5adU1RSjJidTByVXJWbGp1eVVJIiwidHlwIjoiSldUIn0..mCsInK0ijA9BLMxNjesJFUoGPAavnWgDTVGubRxJqclUbAxTPJ1rGe5CxbOHlPEr2oJG3uV2YLXNYkA0MICXP_YXNXgpcRczSKXMUX0VRtVYXdIXoN5aV995-b39jBFzAQpIjznQAs42mvv2YW5TR11DU8CougXF4-hTBDUaqufmyYE57rcaHiA6H1GoUwEpl8A7C_6p8cweGTao5FHmOh-BwF583yIGs_c2AEE4ozSzfd7J82wmkrczFFwC5FQYCP3byyGwC4SM5Npi9_QiQXjamyBV7uRmcHSbLky5NBd7Wc6ZprrNj8XL5DVAAeBsMWVhJ-IQ_Mkd7ShuGtafhg";

              const res = await Promise.all([
                  fetch('https://api.preqin.com/api/Investor?FirmID=2670', {
                    headers: {
                      'Authorization': 'Bearer ' + token
                    }
                  }),
                  fetch('https://api.preqin.com/api/Investor?FirmID=2792', {
                    headers: {
                      'Authorization': 'Bearer ' + token
                    }
                  })
              ]);            

              const data = await Promise.all(res.map(r => r.json()))

               setTimeout(myMessage, 3000);

              console.log("DATA " + data.flat());

              setData1(data.flat());
              setLoading(false);

            } catch (err) {
              //console.log("ERROR HERE" + err);
              setError(true);
            }
          };

          fetchData();
    }, []);

    return {data1, loading, error}
}

export default useFetch;
